import React, { useState, useEffect } from 'react'
import Checkbox from '@material-ui/core/Checkbox';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import Input from '@material-ui/core/Input';    
import ListItemText from '@material-ui/core/ListItemText';
import Container from '@material-ui/core/Container';
import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import './css/header.css'




export default function Header() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('http://www.mocky.io/v2/5c9105cb330000112b649af8')
        .then(res =>{
            return res.json()
        })
        .then(response =>{
            setData(response.furniture_styles)
        })
        }, [])


        const optionSelect = data.map((item, index) =>{
            return(
                <MenuItem key={index} value={item}>
                    <Checkbox value="uncontrolled"/>
                    <ListItemText primary={index} />
                </MenuItem>
            )
        })

        const handleChange = event => {
            console.log(event)
        }

        
    

    return (
        <div>
            <Container fixed>
                <FormControl className="form-container">
                <InputLabel id="demo-mutiple-checkbox-label">Furtniture Style</InputLabel>
                    <Select 
                        multiple
                        value ={data}
                        input={<Input />}
                        onChange={handleChange}   
                        >
                        {optionSelect}
                    </Select>
                </FormControl>
            </Container>
        </div>
    )
}
